    [],nt"revision_timestamp": "2016-03-21T18:31:10.324572",nt"name": "economic-data-collection-for-gulf-of-mexico-south-atlantic-shrimp-fisheries",nt"isopen":
    false,nt"url": null,nt"notes": "The Annual Economic Survey of Federal Gulf
    and Atlantic Shrimp Permit Holders collects data about operating expenses and costs
    of owning and maintaining shrimp vessels. Each spring, surveys are sent by mail
    to a random sample of 33 of all vessels with federal permits for the harvest of
    Gulf of Mexico penaeid shrimp or South Atlantic penaeid or rock shrimp. This information
    is used to assess trends in the financial and economic state of the fisheries, and
    to determine the economic and social effects of regulations and other factors affecting
    the Southeast shrimp fisheries. The individual information is confidential and only
    summary statistics are released to the public.",nt"license_title": null,nt"extras":
